import React, { useState, useEffect, useContext } from "react";
import axios from "axios";
import { AppContext } from "../../Context/AppContext";
import "./Formula.css";

function Formula() {
  const { username: currentUsername } = useContext(AppContext);
  const [formulas, setFormulas] = useState([]);
  const [editingFormula, setEditingFormula] = useState(null);
  const [newFormula, setNewFormula] = useState({
    formulaName: "",
    formulaCostCode: "",
    edited: false,
    itemId: "",
  });

  useEffect(() => {
    // Fetching formulas from API
    axios
      .get("http://localhost:8085/formulas")
      .then((response) => {
        setFormulas(response.data);
      })
      .catch((error) => {
        console.error("Error fetching formula data:", error);
      });
  }, []);

  const handleAddFormula = () => {
    axios
      .post("http://localhost:8085/formulas", newFormula)
      .then((response) => {
        setFormulas([...formulas, response.data]);
        setNewFormula({
          formulaName: "",
          formulaCostCode: "",
          edited: false,
          itemId: "",
        });
      })
      .catch((error) => {
        console.error("Error adding new formula:", error);
      });
  };

  const handleRowClick = (formula) => {
    setEditingFormula({ ...formula });
  };

  const updateFormula = (formulaId, updatedFormula) => {
    axios
      .put(`http://localhost:8085/formulas/${formulaId}`, updatedFormula)
      .then(() => {
        const updatedFormulas = formulas.map((formula) => {
          if (formula.id === formulaId) {
            return updatedFormula;
          }
          return formula;
        });
        setFormulas(updatedFormulas);
      })
      .catch((error) => {
        console.error("Error updating formula:", error);
      });
  };

  return (
    <div className="formula-container">
      {/* Formula creation form */}
      <div className="formula-add">
        <input
          value={newFormula.formulaName}
          onChange={(e) =>
            setNewFormula({ ...newFormula, formulaName: e.target.value })
          }
          placeholder="Name"
        />
        <input
          value={newFormula.formulaCostCode}
          onChange={(e) =>
            setNewFormula({ ...newFormula, formulaCostCode: e.target.value })
          }
          placeholder="Cost Code"
        />
        <button onClick={handleAddFormula}>Add Formula</button>
      </div>

      {/* Formulas table */}
      <table>
        <thead>
          <tr>
            <th>NAME</th>
            <th>COST_CODE</th>
            <th>EDITABLE</th>
            <th>ITEM_ID</th>
          </tr>
        </thead>
        <tbody>
          {formulas.map((formula) => (
            <tr key={formula.id} onClick={() => handleRowClick(formula)}>
              <td>{formula.formulaName}</td>
              <td>{formula.formulaCostCode}</td>
              <td>{formula.edited ? "Yes" : "No"}</td>
              <td>{formula.itemId}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Editing formula details */}
      {editingFormula && (
        <div className="formula-edit">
          <input
            value={editingFormula.formulaName}
            onChange={(e) =>
              setEditingFormula({
                ...editingFormula,
                formulaName: e.target.value,
              })
            }
            placeholder="Name"
          />
          <input
            value={editingFormula.formulaCostCode}
            onChange={(e) =>
              setEditingFormula({
                ...editingFormula,
                formulaCostCode: e.target.value,
              })
            }
            placeholder="Cost Code"
          />
          <button
            onClick={() => updateFormula(editingFormula.id, editingFormula)}
          >
            Update Formula
          </button>
          <button onClick={() => setEditingFormula(null)}>Cancel</button>
        </div>
      )}
    </div>
  );
}

export default Formula;
